import Layout from '../common/Layout';
//axios로 데이터를 불러오려면 UseEffect로 의존성 배열을 비워놓은 다음에 해당 컴포넌트가 처음 마운터 되는 순간 한 번만 데이터를 불러오도록 처리를 해야 함
import axios from 'axios';
import { useEffect, UseEffect } from 'react';

function Member() {
	useEffect(() => {
		axios.get(process.env.PUBLIC_URL + '/DB/members.json').then((json) => {
			console.log(json.data.members);
			//fetch와는 다르게 json 데이터로 파싱할 필요 없이 바로 불러와짐
		});
	}, []);
	return (
		<Layout name={'Members'}>
			<p>members</p>
		</Layout>
	);
}

export default Member;
